import React from 'react';
import Canvas from './Canvas';

function App() {
  const drawArt = (ctx: CanvasRenderingContext2D) => {
    ctx.fillStyle = 'red';
    ctx.fillRect(0, 0, 100, 100);
  };
  return (
    <><div>
      <Canvas draw={drawArt} width={600} height={400}></Canvas>

    </div>
    </>
  );
}

export default App;
